function tick() {
  
    const element = (
      <div>
        <h1>
          Witaj, {formatName(user)}!
        </h1>
        <h2>
        Aktualny czas: {new Date().toLocaleTimeString()}.
        </h2>
      </div>
    );
   
  
    ReactDOM.render(
      element,
      document.getElementById('root')
    );
  }
export default tick;
